import React,{Component} from 'react';
import Menu1 from './Menu1';
import "../../node_modules/video-react/dist/video-react.css";
import '../Css/Anaesthesia.css';
import Bottom from './Bottom';
import { Player } from 'video-react';
import axios from 'axios';
var images = require.context('../Backened/ADMIN_WALLET/allopathic/anaesthesia', true);

const Exercise = props => (
   <tr>
     <td>
          <div className="ka">
            <p className="karam">Approved By DIGIDOC:</p>  
          <br/>
     <Player className="skol"  fluid={false}
         width={750} height={400}
         playsInline    poster="/assets/poster.png" 
         src={images(`./${props.exercise.imagename}`)}/>
        <br/>
         <div className="silk">
        <div >DESCRIPTION : <div id="dd"> <i>{props.exercise.description}</i></div></div>
        <div> UPLOADED BY :  DR.{props.exercise.name}</div>
        <div> SPECIALITY :  D.M.({props.exercise.speciality})</div>
        <div> WORK EXPERIENCE:  {props.exercise.exp} YRS</div>

        </div>
        </div>

       <br/>
       <br/>
      </td>
  </tr> 
)

export default class ALL_Anaesthesia extends Component 
{
  constructor(props) {
    super(props);
    this.state = {exercises: []};
                }
                componentDidMount() 
  {
    axios.get('http://localhost:5000/get/allopathic/anaesthesia')
      .then(response => {
        this.setState({ exercises: response.data })
      })
      .catch((error) => {
        console.log(error);
      })
  }
  onSub()
  {
    window.location=('/Allopathic');
  }
  exerciseList() {
    return this.state.exercises.map(currentexercise => {
      return <Exercise exercise={currentexercise} key={currentexercise._id}/>;
    })
  }
    render(){
  return (
     <div >  
       <Menu1/>
       <br/>
       <br/>
       <br/>
       <h1 className="kok">Anaesthesia<span align="right"><button onClick={this.onSub}>BACK</button></span></h1>
    <br/>
    <br/>
    <table id="cust" align="center" border="0">
          <tbody > 
            { this.exerciseList() }
          </tbody>
    </table>
    <br/>
    <br/>
<Bottom/>
    </div>
      )
}
}
